import React, { useState, useEffect } from 'react';
import './AddEnclosureForm.css';

const AddEnclosureForm = () => {
  const [enclosures, setEnclosures] = useState([]);
  const [enclosure_id, setID] = useState('');
  const [name, setName] = useState('');
  const [enclosure_type, setType] = useState('');
  const [build_date, setBuildDate] = useState('');
  const [address, setAddress] = useState('');
  const [cleaning_start, setCleaningStart] = useState('');
  const [cleaning_end, setCleaningEnd] = useState('');

  useEffect(() => {
    fetchEnclosures();
  }, []);

  const fetchEnclosures = async () => {
    try {
      const response = await fetch('/enclosures');
      const data = await response.json();
      setEnclosures(data);
    } catch (error) {
      console.error('Error fetching enclosures:', error);
    }
  };

  const addEnclosure = async (newEnclosure) => {
    try {
      const response = await fetch('/enclosures', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(newEnclosure),
      });
      if (response.ok) {
        fetchEnclosures();
      } else {
        console.error('Failed to add enclosure:', response.statusText);
      }
    } catch (error) {
      console.error('Error adding enclosure:', error);
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!name || !enclosure_id || !enclosure_type || !build_date || !address || !cleaning_start || !cleaning_end) {
      alert('Please fill in all fields');
      return;
    }
    addEnclosure({ enclosure_id, name, enclosure_type, build_date, address, cleaning_start, cleaning_end });
    setID('');
    setName('');
    setType('');
    setBuildDate('');
    setAddress('');
    setCleaningStart('');
    setCleaningEnd('');
  };

  const handleReset = () => {
    setID('');
    setName('');
    setType('');
    setBuildDate('');
    setAddress('');
    setCleaningStart('');
    setCleaningEnd('');
  };

  return (
    <div>
      <h1>Zoo Enclosures</h1>
      <form onSubmit={handleSubmit}>
        <div className="label">Enclosure ID:</div>
        <input
          type="number"
          placeholder="Enclosure ID"
          value={enclosure_id}
          onChange={(e) => setID(e.target.value)}
        />
        <div className="label">Name:</div>
        <input
          type="text"
          placeholder="Name"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
        <div className="label">Enclosure Type:</div>
        <input
          type="text"
          placeholder="Enclosure Type"
          value={enclosure_type}
          onChange={(e) => setType(e.target.value)}
        />
        <div className="label">Build Date:</div>
        <input
          type="date"
          placeholder="Build Date"
          value={build_date}
          onChange={(e) => setBuildDate(e.target.value)}
        />
        <div className="label">Address:</div>
        <input
          type="text"
          placeholder="Address"
          value={address}
          onChange={(e) => setAddress(e.target.value)}
        />
        <div className="label">Cleaning Start Time:</div>
        <input
          type="time"
          placeholder="Cleaning Start Time"
          value={cleaning_start}
          onChange={(e) => setCleaningStart(e.target.value)}
        />
        <div className="label">Cleaning End Time:</div>
        <input
          type="time"
          placeholder="Cleaning End Time"
          value={cleaning_end}
          onChange={(e) => setCleaningEnd(e.target.value)}
        />

        <br></br>

        <button type="submit">Add Enclosure</button>
        <button type="button" onClick={handleReset}>Reset</button>
      </form>
    </div>
  );
};

export default AddEnclosureForm;
